#!/system/bin/sh
PKG="plugin2.htetznaing.com.oppo.qemu.keyboard"
data=""
path="/data/local/tmp/zmod_plugin2.apk"
echo "[-] Decoding"
if decode_result=$(echo -n "$data" | base64 -d > $path); then
    echo "[-] Installing"
    echo "[!] You may need to tap \"INSTALL ANYWAY\" when the dialog box appears."
    if install_result=$(pm install -g "$path"); then
        echo "[-] Settings up"
        if permission_result=$(pm grant "$PKG" android.permission.WRITE_SECURE_SETTINGS); then
	        success="[âœ“] Success"
            echo "$success"
            rm -f "$path"
            rm -f "$0"
            if [ ! -n "$1" ]; then
	            am start -a zfont.action.PLUGIN_INSTALL_RESULT -f 268435456 --es message "$success"
            fi
        fi
    else
        echo "[x] Installation failed!"
    fi
else
  echo "[x] Decoding failed"
fi